import { Component } from "react"
class Main extends Component{
    render(){
        return(
            <div className="container" style={{marginTop:"12em",justifyContent:"center"}}>

            
            <div className="row">
            <header>Personal Details</header>
            </div>
            <div className="form col-lg-10">
                hello world
            </div>
            </div>
            )
    }
}
export default Main
